                  <td>{fav.date.iso}</td>
                </tr> :
               <h2>No Favourites yet..</h2>
              ))} */}
            </tbody>
          </table>
        ) : (
          <p>No favorites yet..</p>
        )}
      </div>
    </div>
  );
}

export default Favorites;
